You can use the `useEffect` hook to close the tooltip when the content changes. Here is the updated code:

```
import React, { createContext, useContext, useState, useEffect } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [isOpen, setIsOpen] = useState(false);
  const [content, setContent] = useState('');

  const openTooltip = (text) => {
    setIsOpen(true);
    setContent(text);
  };

  const closeTooltip = () => {
    setIsOpen(false);
    setContent('');
  };

  useEffect(() => {
    if (isOpen && content) {
      closeTooltip();
    }
  }, [isOpen, content]);

  return (
    <TooltipContext.Provider value={{ isOpen, content, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
