    <div id="timer">10</div>
    <button id="playAgain">Play Again</button>
  </div>

  <script>
    let clickCount = 0;
    let timer;
    const clickCountElement = document.getElementById('clickCount');
    const timerElement = document.getElementById('timer');
    const playAgainButton = document.getElementById('playAgain');

    function startGame() {
      clickCount = 0;
      clickCountElement.textContent = clickCount;
      timerElement.textContent = 10;
      clearInterval(timer);
      timer = setInterval(() => {
        timerElement.textContent--;
        if (timerElement.textContent === '0') {
          clearInterval(timer);
          playAgainButton.style.display = 'block';
        }
      }, 1000);
    }

    function handleClick() {
      clickCount++;
      clickCountElement.textContent = clickCount;
    }

    document.addEventListener('click', handleClick);
    playAgainButton.addEventListener('click', startGame);

    startGame();
  </script>
</body>
</html>
```

This game displays a click count and a timer. When the game starts, the timer counts down from 10 seconds. During this time, each mouse click increments the click count. When the timer reaches 0, the game ends, and a "Play Again" button appears. Clicking this button restarts the game.

